import React from 'react';
import './Estilos/Botones-slider.css'; // Importa tu archivo de estilos CSS para los botones personalizados

const CustomNextArrow = (props) => {
    const { className, onClick } = props;
    return (
        <div className={`custom-next-arrow ${className}`} onClick={onClick}>
            Next
        </div>
    );
};

const CustomPrevArrow = (props) => {
    const { className, onClick } = props;
    return (
        <div className={`custom-prev-arrow ${className}`} onClick={onClick}>
            Prev
        </div>
    );
};

export { CustomNextArrow, CustomPrevArrow };
